import React from 'react';
import ActiveLink from '../../../UiElements/NavLink/NavLink';
import Menu, { MenuItem, MenuLink } from './TopMenu.style';

const menuItems = [
  {
    id: 1,
    label: 'Feedback',
    path: '/feedback',
  },
  {
    id: 2,
    label: 'Blog',
    path: '/blog',
  },
  {
    id: 3,
    label: 'Supports',
    path: '/supports',
  },
  {
    id: 4,
    label: 'Docs',
    path: '/docs',
  },
];

type MenuProps = {
  className?: string;
  onClick?: () => void;
};

const TopMenu = ({ className, onClick }: MenuProps) => {
  return (
    <Menu className={className}>
      {menuItems.map(item => (
        <MenuItem key={`top-menu--item${item.id}`} onClick={onClick}>
          <ActiveLink activeClassName="active" href={item.path}>
            <MenuLink>{item.label}</MenuLink>
          </ActiveLink>
        </MenuItem>
      ))}
    </Menu>
  );
};

export default TopMenu;
